import axios  from "axios";


const URL =  "http://localhost:8080/api/validateUser"

const getUser = async ()=>{
        
      const respone  = await axios.get(URL,{data : userData})

      const data = await respone.data

      console.log(data)
}

const userData = {

            "email_id":"subham10022000@gmail.com",
            "password":"iamsubham"
        
}

export default getUser
